import { Component, Inject, ViewEncapsulation } from '@angular/core';
import { Http, Headers, RequestOptions, Response } from '@angular/http';

@Component({
  selector: 'app-event-create',
  templateUrl: './create.component.html',
  encapsulation: ViewEncapsulation.None
})
export class EventCreateComponent {

  constructor(
    @Inject('appService') private appService: any,
    private http: Http,
  ) {
    this.event().subscribe(res => {
      console.log(res);
    });
  }

  event() {
    const headers = new Headers({
      'X-Parse-Application-Id' : this.appService.XParseApplicationId,
      'X-Parse-REST-API-Key': this.appService.XParseRESTAPIKey,
      'Content-Type': 'application/json'
    });
    console.log('creating event');
    const body = {
      user: {
        objectId: localStorage.getItem('userId'),
        sessionId: localStorage.getItem('sessionId')
      },
      data: {
        Name: 'New Event Created Via Admin Panel',
        FoodItems: ['j27z4Yeyp9'],
        Description: 'New Event Description',
        StartDateTime: '2017-12-20T16:06:06.271Z',
        EndDateTime: '2017-12-21T16:06:06.271Z',
        TableLayout: 'eAj69u7Qgy',
        Status: 'Draft',
        Category: 'Concert',
        TicketTypeTables: {
          "UBJ1olK8JO": [
            1,
            2,
            3,
            4,
            5,
            6
          ]
        },
        Timeslots: false,
        MaxReservationLength: 30,
          Picture: {
            name: 'picALtered.jpg',
            base64img: ''
          }
      },
      className: 'Event'
    };
    const url = 'https://api.alpenhaus.ru/alpenhaus/functions/createEvent';
    const options = new RequestOptions({
      headers: headers,
      body: body
    });
    return this.http.post(url, {}, options).map(res => res.json());
  }
}
